import "./CSS/index.css";
import Card from "./Component/Card";
import { BrowserRouter as Router, Link, Routes, Route } from "react-router-dom";
import { ArrowLeft } from "phosphor-react";

function App() {
  return (
    <>
      <Card></Card>;
      <Router>
      <Link to={"/"}>



        <Routes>
          <Route
            path="/detail"
            element={<ArrowLeft size={48} className="arrow" />}
          />
        </Routes>
      </Link>
      </Router>
    </>
  );
}

export default App;
